DROP TABLE IF EXISTS `config_codes`;

CREATE TABLE `config_codes` (
  `app_key` varchar(32) NOT NULL DEFAULT '0' COMMENT '默认的配置codes 的appKey 比如某某子项目 等 如果没有子项目 或者最高级项目  默认为default 的值0',
  `rel_obj_id` varchar(32) NOT NULL DEFAULT '0' COMMENT '默认的配置codes 的appKey 对应的某个对象的ID',
  `type` varchar(32) NOT NULL COMMENT '配置的类型',
  `key` varchar(32) NOT NULL,
  `value` varchar(512) NOT NULL,
  `desc` varchar(255) DEFAULT NULL COMMENT '描述',
  `creator` bigint(20) NOT NULL COMMENT '创建者ID',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `updater` bigint(20) NOT NULL COMMENT '修改者',
  `update_time` datetime NOT NULL COMMENT '最后修改时间',
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`id`),
  KEY `type` (`app_key`,`rel_obj_id`,`type`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8 COMMENT='圣代项目一对多codes统一配置表';

